import React from "react";
import {Box, Grid, Typography, Button } from "@material-ui/core";

export default (props) => (
<Box py ={10} bgcolor="secondary.main" color="white">
    <Grid container justify="center">
        <Grid item xs ={10}>
            <Box display="flex" justifyContent="space-">
    <Typography variant="h3">Rss Feed Junior Jobs</Typography>
    <Typography variant="h6">Encuentra tu empleo o internship</Typography>
    <br/>
    <Button variant="contained" color="primary" disableElevation>Buscar</Button>
    </Box>
    </Grid>
    </Grid>
</Box>
);
